His online career and Quick Video Marketing course started with zero capital while recovering in a hospital bed after back surgery. That’s right, Jeff was making money online while laying in bed!&#13;
&#13;
In 2008, Jeff went from zero to six figures in just over 6 months with the acclaimed Quick Video Marketing course. Now sought after for launches, online integration, copywriting, and consultations, Jeff and Scott are looking to pass the seven figure mark for 2009.
